using System;\nusing System.Collections;\nusing System.Collections.Generic;\n\npublic class Program\n{\n    public static void Main()\n    {\n        ArrayList list1 = new ArrayList();\n        list1.Add("String1");\n        list1.Add("String2");\n        list1.Add("String3");\n\n        ArrayList list2 = new ArrayList();\n        list2.Add("String3");\n        list2.Add("String2");\n        list2.Add("String1");\n\n        Console.WriteLine(GetHashCodeOfList(list1)); // Should be equal\n        Console.WriteLine(GetHashCodeOfList(list2)); // Should be equal\n    }\n\n    public static int GetHashCodeOfList(ArrayList list)\n    {\n        int hash = 0;\n\n        foreach (string str in list)\n        {\n            hash ^= str.GetHashCode();\n        }\n\n        return hash;\n    }\n}